(23, 'behavior_definition', 2, 'cn', ''),
(24, 'behavior_definition', 2, 'en', ''),
(25, 'behavior_definition', 3, 'tw', '不先入為主，視不同狀況調整溝通技巧，傾聽並接受別人意見能站在對方立場，以同理心與對方展開良性互動'),
(26, 'behavior_definition', 3, 'cn', ''),
(27, 'behavior_definition', 3, 'en', ''),
(28, 'behavior_definition', 4, 'tw', '會運用各種不同工具(統計數據、圖表、簡報檔或適當實例的舉出等)，清楚表達訊息予傳達對象，讓對方明瞭。'),
(29, 'behavior_definition', 4, 'cn', ''),
(30, 'behavior_definition', 4, 'en', ''),
(31, 'behavior_definition', 5, 'tw', '能協調、調動任務執行所需的資源，並分析溝通重點的優劣，提出令雙方同意的解決方案，並支持、追蹤以圓滿完成後續的工作任務。'),
(32, 'behavior_definition', 5, 'cn', ''),
(33, 'behavior_definition', 5, 'en', ''),
(34, 'competency_definition', 2, 'tw', '協調部屬/同事間與自己不同的意見，並主動拓展與維繫組織有關的人際網絡。'),
(35, 'competency_definition', 2, 'cn', ''),
(36, 'competency_definition', 2, 'en', ''),
(37, 'behavior_definition', 6, 'tw', '在工作上能夠與他人進行必要的接觸與關係維持，並明確表達自己的友好和善意互動。'),
(38, 'behavior_definition', 6, 'cn', ''),
(39, 'behavior_definition', 6, 'en', ''),
(40, 'behavior_definition', 7, 'tw', '能建立工作所需之良好人際關係網絡，並能與不同部門的同仁合作共事。'),
(41, 'behavior_definition', 7, 'cn', ''),
(42, 'behavior_definition', 7, 'en', ''),
(43, 'behavior_definition', 8, 'tw', '遇到困難時，能主動尋求有助於改善工作的人際網絡，並能維繫長期合作關係。'),
(44, 'behavior_definition', 8, 'cn', ''),
(45, 'behavior_definition', 8, 'en', ''),
(46, 'behavior_definition', 9, 'tw', '對於工作同仁的個性、家庭或生活有基本的關心跟了解。'),
(47, 'behavior_definition', 9, 'cn', ''),
(48, 'behavior_definition', 9, 'en', ''),
(49, 'behavior_definition', 10, 'tw', '能積極、主動經營對工作有益的人際網絡關係。'),
(50, 'behavior_definition', 10, 'cn', ''),
(51, 'behavior_definition', 10, 'en', ''),
(52, 'competency_definition', 3, 'tw', '蒐集、整合運用各種資料，以統計工具或經驗，針對議題組織化、系統化分析，主動提出創新的建議進行規畫執行。'),
(53, 'competency_definition', 3, 'cn', ''),
(54, 'competency_definition', 3, 'en', ''),
(55, 'competency_definition', 4, 'tw', '依部屬工作及職責，說明授權範圍並尊重部屬所做決定，督導其工作及實施的方法，以審視部屬業務執行的成效。'),
(56, 'competency_definition', 4, 'cn', ''),
(57, 'competency_definition', 4, 'en', ''),
(58, 'behavior_definition', 11, 'tw', '能針對實際狀況加以設想，發展出跟以往工作方式不同的新方法來突破、改善現狀。'),
(59, 'behavior_definition', 11, 'cn', ''),
(60, 'behavior_definition', 11, 'en', ''),
(61, 'behavior_definition', 12, 'tw', '能夠利用各種可能促進創意的技術，如小組討論法、腦力激盪法、經驗分享等，協助個人或團體產生其他更好的產品創意和處理模式。'),
(62, 'behavior_definition', 12, 'cn', ''),
(63, 'behavior_definition', 12, 'en', ''),
(64, 'behavior_definition', 13, 'tw', '平時就會留意一些新奇的概念或看法，並且在遇到狀況時，運用這些與眾不同的觀念解決問題。'),
(65, 'behavior_definition', 13, 'cn', ''),
(66, 'behavior_definition', 13, 'en', ''),
(67, 'behavior_definition', 14, 'tw', '能綜合別人的意見及看法，創造出全新的概念。'),
(68, 'behavior_definition', 14, 'cn', ''),
(69, 'behavior_definition', 14, 'en', ''),
(70, 'behavior_definition', 15, 'tw', '能夠主動發覺問題、尋找各種創意來源，創造出新的解決方案及各種創意。'),
(71, 'behavior_definition', 15, 'cn', ''),
(72, 'behavior_definition', 15, 'en', ''),
(73, 'behavior_definition', 16, 'tw', '了解部屬的職務內容與工作重點，以督導部屬工作的成效。'),
(74, 'behavior_definition', 16, 'cn', ''),
(75, 'behavior_definition', 16, 'en', ''),
(76, 'behavior_definition', 17, 'tw', '讓部屬知道主管用什麼標準來督導他們的工作表現，並且能夠依據實際的情況及部屬的反應，調整控管的方法。'),
(77, 'behavior_definition', 17, 'cn', ''),
(78, 'behavior_definition', 17, 'en', ''),
(79, 'behavior_definition', 18, 'tw', '培養員工自我管理的能力，容許其犯錯，透過改善，朝目標努力實現。'),
(80, 'behavior_definition', 18, 'cn', ''),
(81, 'behavior_definition', 18, 'en', ''),
(82, 'behavior_definition', 19, 'tw', '由公司的長期利益出發，透過督導機制，讓部門人員工作的成效調整符合組織未來發展需求。'),
(83, 'behavior_definition', 19, 'cn', ''),
(84, 'behavior_definition', 19, 'en', ''),
(85, 'behavior_definition', 20, 'tw', '除了正式文件的規定外，還能夠依主管的專業技能來督導部屬工作上的表現，以符合公司最終利益。'),
(86, 'behavior_definition', 20, 'cn', ''),
(87, 'behavior_definition', 20, 'en', ''),
(88, 'competency_definition', 5, 'tw', '能針對部屬工作能力的不足之處，提供培訓與諮詢，以激發部屬的潛力，並適時給予指導。'),
(89, 'competency_definition', 5, 'cn', ''),
(90, 'competency_definition', 5, 'en', ''),
(91, 'behavior_definition', 21, 'tw', '能因材施教、激發部屬潛力，培育有助於組織發展的部屬。'),
(92, 'behavior_definition', 21, 'cn', ''),
(93, 'behavior_definition', 21, 'en', ''),
(94, 'behavior_definition', 22, 'tw', '依據目前單位的發展能夠有計劃、持續的提供機會給部屬進行工作歷練的指導與建議。'),
(95, 'behavior_definition', 22, 'cn', ''),
(96, 'behavior_definition', 22, 'en', ''),
(97, 'behavior_definition', 23, 'tw', '能清楚知道部屬其自身的優缺點，傾聽部屬的發展需求，擬訂合適的職涯發展方向，並安排長期的指導或訓練。'),
(98, 'behavior_definition', 23, 'cn', ''),
(99, 'behavior_definition', 23, 'en', ''),
(100, 'behavior_definition', 24, 'tw', '能夠主動瞭解部屬的工作進度是否遭遇到困難或需要資源的協助。'),
(101, 'behavior_definition', 24, 'cn', ''),
(102, 'behavior_definition', 24, 'en', ''),
(103, 'behavior_definition', 25, 'tw', '協助部屬分析/評估可能遇到的困難，並願意提供部屬詳細的指導與諮詢。'),
(104, 'behavior_definition', 25, 'cn', ''),
(105, 'behavior_definition', 25, 'en', ''),
(106, 'competency_definition', 6, 'tw', '能夠理性分析問題，有效的整合運用所獲得的各種資訊，尋求根本原因並提出有效的解決方式及預防措施。'),
(107, 'competency_definition', 6, 'cn', ''),
(108, 'competency_definition', 6, 'en', ''),
(109, 'behavior_definition', 26, 'tw', '能夠分辨問題的重要性與優先順序，在解決問題時能整合不同來源的資料，分析出問題的多重關係，建立解決問題的知識以及可依循的問題解決模式。'),
(110, 'behavior_definition', 26, 'cn', ''),
(111, 'behavior_definition', 26, 'en', ''),
(112, 'behavior_definition', 27, 'tw', '對於較複雜要素所構成的問題，能找出解決的方法及行動計劃步驟，做出最適合的解決方案及預防措施。'),
(113, 'behavior_definition', 27, 'cn', ''),
(114, 'behavior_definition', 27, 'en', ''),
(115, 'behavior_definition', 28, 'tw', '樂於接受新穎的觀念、方法及新的資訊，不受限於特定領域之習慣想法與做法，並提出具體可行的解決方案。'),
(116, 'behavior_definition', 28, 'cn', ''),
(117, 'behavior_definition', 28, 'en', ''),
(118, 'behavior_definition', 29, 'tw', '能針對自身決策範圍內的問題或機會，提出多項可行方案，進行評估分析以找出最佳的解決方法。'),
(119, 'behavior_definition', 29, 'cn', ''),
(120, 'behavior_definition', 29, 'en', ''),
(121, 'behavior_definition', 30, 'tw', '能預測到問題的障礙及可能發生的結果，以進行問題預防發生的風險管控措施。'),
(122, 'behavior_definition', 30, 'cn', ''),
(123, 'behavior_definition', 30, 'en', ''),
(124, 'competency_definition', 7, 'tw', '有效管理時間和運用公司資源，監督控管並持續追蹤進度，以確保時效內，達成公司目標。\r'),
(125, 'competency_definition', 7, 'cn', ''),
(126, 'competency_definition', 7, 'en', ''),
(127, 'behavior_definition', 31, 'tw', '事先進行工作規劃，透過標準作業流程執行工作，達成工作進度確保任務品質與控制成本。\r'),
(128, 'behavior_definition', 31, 'cn', ''),
(129, 'behavior_definition', 31, 'en', ''),
(130, 'behavior_definition', 32, 'tw', '能將計畫展開與工作分配，掌握好每個關鍵的執行檢核點，以確保工作方向與內容的正確性。\r'),
(131, 'behavior_definition', 32, 'cn', ''),
(132, 'behavior_definition', 32, 'en', ''),
(133, 'behavior_definition', 33, 'tw', '計畫發生變化時能事先擬定應對策略及行動方案，確保各計畫的正常運作。\r'),
(134, 'behavior_definition', 33, 'cn', ''),
(135, 'behavior_definition', 33, 'en', ''),
(136, 'behavior_definition', 34, 'tw', '當進度落後或遇到困難時，會立即發出警訊，並尋求相關資源與協助以解決困難，確保在預定時間內完成工作任務。\r'),
(137, 'behavior_definition', 34, 'cn', ''),
(138, 'behavior_definition', 34, 'en', ''),
(139, 'behavior_definition', 35, 'tw', '能使單位中的成員瞭解成功執行的重要性，並注意執行的過程與方法是否達到預期的效率與效益。\r'),
(140, 'behavior_definition', 35, 'cn', ''),
(141, 'behavior_definition', 35, 'en', ''),
(142, 'competency_definition', 8, 'tw', '對於預定的工作計畫或上司交辦的事項，能判斷工作輕重緩急進行工作安排，確實遵循作業標準流程，注重工作細節與品質，在既定的時間內有效完成工作目標。'),
(143, 'competency_definition', 8, 'cn', ''),
(144, 'competency_definition', 8, 'en', ''),
(145, 'behavior_definition', 36, 'tw', '執行工作前，會預先思考，安排各作業的先後執行順序；並運用各種能提升或改善工作執行成效的軟硬體工具和設備，以提高執行效率。\r'),
(146, 'behavior_definition', 36, 'cn', ''),
(147, 'behavior_definition', 36, 'en', ''),
(148, 'behavior_definition', 37, 'tw', '能檢討/改良作業技術及方法，以提高作業效率及品質。並在客戶要求的標準及作業期限前，如質、如量的完成工作任務。\r'),
(149, 'behavior_definition', 37, 'cn', ''),
(150, 'behavior_definition', 37, 'en', ''),
(151, 'behavior_definition', 38, 'tw', '能自我省察工作成效，會留意並減少作業過程間不當的浪費與耗損。'),
(152, 'behavior_definition', 38, 'cn', ''),
(153, 'behavior_definition', 38, 'en', ''),
(154, 'behavior_definition', 39, 'tw', '會檢討工作執行的效率與效益，並找出改善方案持續改進，讓工作品質、流程與效率都能比上一次更好。\r'),
(155, 'behavior_definition', 39, 'cn', ''),
(156, 'behavior_definition', 39, 'en', ''),
(157, 'behavior_definition', 40, 'tw', '能持續地進行改善作業流程並落實於實際的工作中，使工作品質或效率上都能有所提升。\r'),
(158, 'behavior_definition', 40, 'cn', ''),
(159, 'behavior_definition', 40, 'en', ''),
(160, 'competency_definition', 9, 'tw', '能辨識出會影響達成目標可能的障礙，區分問題的徵兆，蒐集並評估證據，找出原因，確定問題發生的真正根源以挑選最適當的行動執行問題解決。'),
(161, 'competency_definition', 9, 'cn', ''),
(162, 'competency_definition', 9, 'en', ''),
(163, 'behavior_definition', 41, 'tw', '當問題發生時，能將問題具體化及描繪清楚，確定其關鍵點以找出問題的根源，加以改善之後確保對方充分瞭解，再來執行。\r'),
(164, 'behavior_definition', 41, 'cn', ''),
(165, 'behavior_definition', 41, 'en', ''),
(166, 'behavior_definition', 42, 'tw', '能針對日常工作中所面臨的障礙與問題，提出改善計畫及解決方案，並且根據綜合判斷的結果，製訂一個最有效的解決方案。\r'),
(167, 'behavior_definition', 42, 'cn', ''),
(168, 'behavior_definition', 42, 'en', ''),
(169, 'behavior_definition', 43, 'tw', '針對自身決策範圍內的問題，提出可行的解決方案，整合相關人員共同執行以達成最終期望的結果。'),
(170, 'behavior_definition', 43, 'cn', ''),
(171, 'behavior_definition', 43, 'en', ''),
(172, 'behavior_definition', 44, 'tw', '對於非自身決策範圍或由許多因素所構成的複雜問題，能在現有條件限制下，規劃出多種可能的解決方法與方案，提供上級決策。'),
(173, 'behavior_definition', 44, 'cn', ''),
(174, 'behavior_definition', 44, 'en', ''),
(175, 'behavior_definition', 45, 'tw', '能將解決問題的知識與技巧妥善紀錄、保存與管理，並且建立一套標準化的問題解決程序，做為以後處理類似問題的參考。\r'),
(176, 'behavior_definition', 45, 'cn', ''),
(177, 'behavior_definition', 45, 'en', ''),
(178, 'competency_definition', 10, 'tw', '能與他人通力合作，彼此互相溝通協助，以解決問題或完成計畫，相互合作而非互相競爭。\r'),
(179, 'competency_definition', 10, 'cn', ''),
(180, 'competency_definition', 10, 'en', ''),
(181, 'behavior_definition', 46, 'tw', '能協調團隊成員共同解決團隊面臨的問題和困難，使工作任務得以順利達成。'),
(182, 'behavior_definition', 46, 'cn', ''),
(183, 'behavior_definition', 46, 'en', ''),
(184, 'behavior_definition', 47, 'tw', '能有效界定團隊成員各自所扮演的角色，使團隊成員感受到在團隊中的重要性，放下個人利益、配合團隊的決議，進而產生團隊的向心力與忠誠度。\r'),
(185, 'behavior_definition', 47, 'cn', ''),
(186, 'behavior_definition', 47, 'en', ''),
(187, 'behavior_definition', 48, 'tw', '樂於分享工作資訊與意見，並能與他人相處融洽，保持和諧的互動關係。'),
(188, 'behavior_definition', 48, 'cn', ''),
(189, 'behavior_definition', 48, 'en', ''),
(190, 'behavior_definition', 49, 'tw', '遇到困難時，能夠主動激勵團隊成員，不邀功，不諉過。以鼓舞團隊成員士氣共同完成任務。\r'),
(191, 'behavior_definition', 49, 'cn', ''),
(192, 'behavior_definition', 49, 'en', ''),
(193, 'behavior_definition', 50, 'tw', '能有效執行團隊績效的定期評量機制，真實反饋各團隊成員的績效表現，糾正、改善團隊成員有問題的行為。\r'),
(194, 'behavior_definition', 50, 'cn', ''),
(195, 'behavior_definition', 50, 'en', ''),
(196, 'competency_definition', 11, 'tw', '能夠根據對員工能力的瞭解與需求分析，以協助員工從事學習、鼓勵員工長期的成長發展。'),
(197, 'competency_definition', 11, 'cn', ''),
(198, 'competency_definition', 11, 'en', ''),
(199, 'behavior_definition', 51, 'tw', '樂意分享過去的工作與學習經驗讓部屬可以度過工作上的難關。\r'),
(200, 'behavior_definition', 51, 'cn', ''),
(201, 'behavior_definition', 51, 'en', ''),
(202, 'behavior_definition', 52, 'tw', '當部屬對執行業務有疑惑時，會透過實地的教導來解決部屬的問題，並願意提供部屬詳細的指導與諮詢。'),
(203, 'behavior_definition', 52, 'cn', ''),
(204, 'behavior_definition', 52, 'en', ''),
(205, 'behavior_definition', 53, 'tw', '能正確評估部屬的能力，並會依此安排持續特定的指導和訓練。\r'),
(206, 'behavior_definition', 53, 'cn', ''),
(207, 'behavior_definition', 53, 'en', ''),
(208, 'behavior_definition', 54, 'tw', '當部屬遭遇到挫折時，會再次的給他肯定與鼓勵，讓他重拾信心並針對部屬行為上可以改進的地方提出建議，避開對個人的批評。'),
(209, 'behavior_definition', 54, 'cn', ''),
(210, 'behavior_definition', 54, 'en', ''),
(211, 'behavior_definition', 55, 'tw', '會適度授權給部屬，讓他們能嘗試自已面對問題與承擔責任的機會。'),
(212, 'behavior_definition', 55, 'cn', ''),
(213, 'behavior_definition', 55, 'en', ''),
(214, 'competency_definition', 12, 'tw', '具備冒險意願且能實際行動、勇於突破、不侷限於既有的工作模式，能主動提出創新的建議或想法來規畫執行。'),
(215, 'competency_definition', 12, 'cn', ''),
(216, 'competency_definition', 12, 'en', ''),
(217, 'behavior_definition', 56, 'tw', '能夠根據現有的情況與熟悉的事務中，主動思考是否有其他創新或改善的方案。\r'),
(218, 'behavior_definition', 56, 'cn', ''),
(219, 'behavior_definition', 56, 'en', ''),
(220, 'behavior_definition', 57, 'tw', '能夠利用不相關或偶發的事件，或將自己的想法融入他人的構想，進而整合出其他改善的構想。\r'),
(221, 'behavior_definition', 57, 'cn', ''),
(222, 'behavior_definition', 57, 'en', ''),
(223, 'behavior_definition', 58, 'tw', '當面對阻礙時，能不侷限於既有的工作模式，發覺新的方法來突破現狀以增進效益。\r'),
(224, 'behavior_definition', 58, 'cn', ''),
(225, 'behavior_definition', 58, 'en', ''),
(226, 'behavior_definition', 59, 'tw', '能夠利用各種可能促進創意的技術，如小組討論法、腦力激盪法，協助個人或團體產生其他更好的產品或通路創意。\r'),
(227, 'behavior_definition', 59, 'cn', ''),
(228, 'behavior_definition', 59, 'en', ''),
(229, 'behavior_definition', 60, 'tw', '能夠主動尋找各種可能的創意來源，如競爭者的產品、副產品利用、國外經驗等，協助個人或團體產生其他更好的產品創意。\r'),
(230, 'behavior_definition', 60, 'cn', ''),
(231, 'behavior_definition', 60, 'en', ''),
(232, 'evaluation_scale_item_desc', 1, 'tw', '約有20%或以下能觀察到此行為表現'),
(233, 'evaluation_scale_item_desc', 1, 'cn', ''),
(234, 'evaluation_scale_item_desc', 1, 'en', ''),
(235, 'evaluation_scale_item_desc', 2, 'tw', '約有21%~40%能觀察到此行為表現'),
