(531, 'ability_def', 471, 'tw', '瞭解行業相關領域發展情況，理解公司戰略與局部業務規劃，並據此制定與調整短期工作目標與計畫。'),
(532, 'ability_def', 472, 'tw', '匯總並分析相關行業狀況、競爭因素等外部因素對自身工作職責的機遇與挑戰，結合柒牌戰略，規劃局部業務中期工作重點。');
INSERT INTO `text` (`term_id`, `term_title`, `depend_on_id`, `term_language`, `text_content`) VALUES
(533, 'ability_def', 473, 'tw', '深刻理解外部環境，明晰公司發展態勢，敏銳的發現和捕捉市場的潛在商機，並據此制定局部業務長期發展戰略和規劃，並根據環境和戰略變化進行動態調整。'),
(534, 'ability_def', 474, 'tw', '深刻分析外部環境，預判行業發展趨勢，結合公司狀況，發現與定義公司的戰略目標，明確公司的經營模式和戰略路徑，並隨著外部環境變化，動態調整戰略重點和業務佈局。'),
(535, 'ability_def', 475, 'tw', '根據給定的工作任務，合理規劃時間和行動方案，安排各項任務的輕重緩急。'),
(536, 'ability_def', 476, 'tw', '判斷完成目標所需的各種資源與達成的關鍵路徑，制定詳細執行計畫，在遇到突發問題時能合理的、靈活的調整既定計劃，確保既定目標的達成。'),
(537, 'ability_def', 477, 'tw', '在計畫實施過程中通過階段性跟蹤與回饋確保執行效果，主動評估執行過程中可能存在的風險，提前制定應變方案，確保工作目標保質保量按時完成。'),
(538, 'ability_def', 478, 'tw', '關注執行中的計畫、執行、監控和回饋全過程，界定執行過程中的風險及其應對原則，從整體上把握各項任務執行的進程和效率。'),
(539, 'ability_def', 479, 'tw', '迎難而上，面對工作中的非常規問題能迅速回應、判斷與處理。'),
(540, 'ability_def', 480, 'tw', '在自身職責範圍內，面對資源、時間等限制或衝突的情況下，能當機立斷解決問題，承擔相應的責任和風險。'),
(541, 'ability_def', 481, 'tw', '在資訊不完整或者模糊不清的情況下，對自身職責領域敢於決策，決策可能影響到局部業務的發展。'),
(542, 'ability_def', 482, 'tw', '面對未來不確定性，對公司商業模式、市場策略、戰略規劃等問題敢於決策，決策可能會給公司業務的發展帶來重大影響。'),
