(642, 'competency_definition', 550, 'tw', '能正確同理他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；以及具備對上下與同儕之間的工作說明以達成目標結果，協調過程中能隨時做出適當反應與改善的能力。'),
(643, 'competency_definition', 550, 'cn', '能正確同理他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；以及具備對上下與同儕之間的工作說明以達成目標結果，協調過程中能隨時做出適當反應與改善的能力。'),
(644, 'competency_definition', 550, 'en', '能正確同理他人的感受、需要和觀點，並能清楚表達自己的語意讓對方明瞭；以及具備對上下與同儕之間的工作說明以達成目標結果，協調過程中能隨時做出適當反應與改善的能力。'),
(645, 'competency_definition', 553, 'tw', '能夠運用組織各種相關資源，透過標準作業流程，將策略或計畫有效落實，達到組織既定的目標；有效管理時間和資源，確保在計劃時間內有效率的完成。'),
(646, 'competency_definition', 553, 'cn', '能夠運用組織各種相關資源，透過標準作業流程，將策略或計畫有效落實，達到組織既定的目標；有效管理時間和資源，確保在計劃時間內有效率的完成。'),
(647, 'competency_definition', 553, 'en', '能夠運用組織各種相關資源，透過標準作業流程，將策略或計畫有效落實，達到組織既定的目標；有效管理時間和資源，確保在計劃時間內有效率的完成。'),
(648, 'competency_definition', 556, 'tw', '在對價平等的基礎上，將客戶的需求視為第一要務，與客戶建立及維持良性的互動及合作關係。'),
(649, 'competency_definition', 557, 'tw', '能與內外客戶建立並維持友善的關係或聯繫網絡。'),
(650, 'competency_definition', 558, 'tw', '能針對部屬工作能力的不足之處，提供示範和練習應用的機會；能發揮部屬的潛力，持續追蹤並適時給予指導。'),
(651, 'competency_definition', 559, 'tw', '機敏把握及預測市場狀態，全面地思考和規劃自身業務領域未來發展的藍圖。'),
(652, 'competency_definition', 562, 'tw', '制訂可行的實施方案，有效落實與監控實施，在執行過程中積極應對、預見變化，確保目標的達成。'),
(653, 'competency_definition', 563, 'tw', '面對困難或障礙時，積極應對，敢於決策，確保目標的達成。'),
(654, 'competency_definition', 564, 'tw', '接收生管出貨單通知或變更.能準確及時提供檢貨單和列印出貨外箱標籤 '),
(655, 'competency_definition', 566, 'tw', '接收生管出貨單通知或變更.能準確及時提供檢貨單和列印出貨外箱標籤.並獨立完成裝箱出貨 '),
(656, 'competency_definition', 568, 'tw', '接收生管及各單位需求調撥庫存出貨及提供樣品.基本財務調帳觀念 '),
(657, 'competency_definition', 570, 'tw', '接收庫存出貨通知單列印產品識別標籤.將庫存產品包裝出貨 '),
(658, 'competency_definition', 572, 'tw', '接收生管採購入庫單列印移交單標籤.並完成理貨作業 '),
(659, 'competency_definition', 574, 'tw', '接收品包入庫產品及各單位需求調撥庫存出貨及提供樣品進出倉庫作業 '),
(660, 'competency_definition', 576, 'tw', '接收檢貨單及外箱標籤.將待出貨區產品裝箱打板出貨 '),
(661, 'competency_definition', 578, 'tw', '從進庫到出庫物品維護及減少呆滯品 '),
(662, 'behavior_definition', 580, 'tw', '不預設立場，願意花時間傾聽他人的看法、意見，並能以自身經驗與他人分享以取得共識。'),
(663, 'behavior_definition', 662, 'tw', '當問題發生時，能將問題點描繪清楚，確保對方充分瞭解，並取得雙方的認同。'),
(664, 'behavior_definition', 663, 'tw', '能耐心處理、聆聽內外部客戶抱怨，具同理心不易與人發生衝突。'),
(665, 'behavior_definition', 664, 'tw', '能以直接溝通來排除問題與障礙或婉轉誠實的回應他人所傳達的訊息。'),
(666, 'behavior_definition', 665, 'tw', '能透過自身專業及良好的溝通技巧，來改變客戶的想法或說服客戶。'),
(667, 'behavior_definition', 666, 'tw', '能讓部門或團隊成員清楚瞭解專案的重要性，並依據合約書內容與客戶溝通確認後再執行專案工作。'),
(668, 'behavior_definition', 667, 'tw', '會檢討工作執行的效率與效益，並找出改善方案持續改進，讓工作品質及效率都能比上一次更好。'),
(669, 'behavior_definition', 668, 'tw', ' 會堅持依據公司既定的SOP規範來執行工作，並在工作進度、任務品質與成本控制間取得良好平衡點。'),
(670, 'behavior_definition', 669, 'tw', ' 在專案執行過程中，會依據工作計劃表來監督、控管與查核專案的工作進度，以及工作方向與內容的正確性。'),
(671, 'behavior_definition', 670, 'tw', '當進度落後或遇到困難時，會立即發出警訊，並尋求相關資源與協助，確保在預定時間內完成工作任務。'),
(672, 'behavior_definition', 671, 'tw', '依據合約內容範圍，快速回應並確實解決內、外部客戶的問題與需求。'),
(673, 'behavior_definition', 672, 'tw', '考量所採取的行動或計劃，會對內、外部客戶產生什麼影響。'),
(674, 'behavior_definition', 673, 'tw', '具備成本意識，能以自身專業知識及有效方法，滿足內、外部客戶的期望與需要。'),
(675, 'behavior_definition', 674, 'tw', '能夠思考、規劃讓內、外部客戶與組織利益雙贏，並提升客戶滿意度的方法。'),
(676, 'behavior_definition', 675, 'tw', '用積極正向、就事論事的態度來排除內、外部客戶的衝突，並共同尋求解決方案。'),
(677, 'behavior_definition', 676, 'tw', '在專案執行過程中，會主動與客戶建立緊密的合作關係，藉由良好的人際互動，幫助推動完成工作。'),
(678, 'behavior_definition', 677, 'tw', '能與不同背景的同事和睦共事，建立工作所需的良好人際關係。'),
(679, 'behavior_definition', 678, 'tw', '遇到困難時能善用人際網絡有效解決問題。'),
(680, 'behavior_definition', 679, 'tw', '會主動關心他人(部屬/同事/客戶)的近況及需求。'),
(681, 'behavior_definition', 680, 'tw', '當部屬/同事/客戶遭遇挫折或情緒低落時，會視需要適時給予協助與支持。'),
(682, 'behavior_definition', 681, 'tw', '1.      樂意將經驗分享給部屬，並能以身作則來教導部屬。'),
(683, 'behavior_definition', 682, 'tw', '2.      能夠有計劃、持續的透過不同情境案例的訓練或實作等方式來增強部屬的能力。'),
(684, 'behavior_definition', 683, 'tw', '3.      能正確評估部屬的能力，並會依此安排持續特定的指導和訓練。'),
(685, 'behavior_definition', 684, 'tw', '4.      當部屬有疑惑時，除了告訴他們如何解決外，也會告訴他們實際的成因為何。'),
(686, 'behavior_definition', 685, 'tw', '能啟發部屬瞭解其自身的優缺點，傾聽部屬的發展需求，並幫助他們擬訂合適的職涯發展目標。'),
