INSERT INTO `tpl` (`tpl_id`, `tpl_title`, `tpl_sender`, `tpl_content`, `tpl_trigger`) VALUES
(1, '經副理級360度職能評鑑邀請函', '360 Degree Assessment Administrator', '親愛的 {fullName} 您好：\r\r  在您收到這封郵件時，表示您已被邀請參與本次經副理級管理職能360度評鑑。\r  本次評鑑目的是為了給參與本次評鑑的受評人，提供更明確的管理職能回饋訊息，俾便受評人建立更具針對性的個人發展計畫(IDP)。\r  您的真實回饋訊息，對受評人建立IDP至關重要，請依據您日常對受評人的實際觀察，提供客觀、真實的反饋。\r\r 您至少有一份以上的問卷尚待填寫，請在google瀏覽器登入 {sysURL} 填寫問卷，並請您務必在9月17日(星期四)午夜12點前，將所有評鑑問卷填寫完畢。\r\r 您的登入信息如下：\r 帳號：{user_account}\r 密碼：{password}\r\r 請注意：\r 1、當您填寫問卷過程中需暫時離開系統時，請務必點選「保存」按鈕，以免數據遺失）\r 2、如您要回家做問卷，請抄下網址、帳號及密碼，回家輸入網址後，登入帳號密碼即可填寫問卷。\r 3、填寫完畢後，請務必按「交卷」按鈕，以確認問卷填寫完畢。\r\r 若您在填寫問卷過程當中有任何問題，請洽人事企劃課 蔡明璋 分機135。\r\r 謝謝您的參與！\r\r主管領導力提升專案工作小組 敬上', ''),
(2, '經副理級360度職能評鑑通知函 (評鑑期限即將到期)', '360 Degree Assessment Administrator', '親愛的 {fullName} 您好：\r\r  由於您還有經副理級職能評鑑問卷尚未完成，且評鑑期限即將到期(9月17日 星期四，午夜12:00)，請您儘快撥空登入 {sysURL}  填寫問卷，謝謝您！\r\r  您的登入信息如下：\r  帳號：{user_account} \r  密碼：{password}\r\r請注意：\r\r1、當您填寫問卷過程中需暫時離開系統時，請務必點選「保存」按鈕，以免數據遺失）\r2、如您要回家做問卷，請抄下網址、帳號及密碼，回家輸入網址後，登入帳號密碼即可填寫問卷。\r3、填寫完畢後，請務必按「交卷」按鈕，以確認問卷填寫完畢。\r\r 若您在填寫問卷過程當中有任何問題，請洽人事企劃課 分機135 蔡明璋。\r\r 謝謝您的參與！\r\r主管領導力提升專案工作小組 敬上', ''),
(3, '課級360度職能評鑑邀請函', '360 Degree Assessment Administrator', '親愛的 {fullName} 您好：\r\r  在您收到這封郵件時，表示您已被邀請參與本次課級管理職能360度評鑑。\r  本次評鑑目的是為了給參與本次評鑑的受評人，提供更明確的管理職能回饋訊息，俾便受評人建立更具針對性的個人發展計畫(IDP)。\r  您的真實回饋訊息，對受評人建立IDP至關重要，請依據您日常對受評人的實際觀察，提供客觀、真實的反饋。\r\r 您至少有一份以上的問卷尚待填寫，請在google瀏覽器登入 {sysURL} 填寫問卷，並請您務必在9月17日(星期四)午夜12點前，將所有評鑑問卷填寫完畢。\r\r 您的登入信息如下：\r 帳號：{user_account}\r 密碼：{password}\r\r 請注意：\r 1、當您填寫問卷過程中需暫時離開系統時，請務必點選「保存」按鈕，以免數據遺失）\r 2、如您要回家做問卷，請抄下網址、帳號及密碼，回家輸入網址後，登入帳號密碼即可填寫問卷。\r 3、填寫完畢後，請務必按「交卷」按鈕，以確認問卷填寫完畢。\r\r 若您在填寫問卷過程當中有任何問題，請洽人事企劃課 蔡明璋 分機135。\r\r 謝謝您的參與！\r\r主管領導力提升專案工作小組 敬上', 'INVITE'),
(4, '課級360度職能評鑑通知函 (評鑑期限即將到期)', '360 Degree Assessment Administrator', '親愛的 {fullName} 您好：\r\r  由於您還有經副理級職能評鑑問卷尚未完成，且評鑑期限即將到期(9月17日 星期四，午夜12:00)，請您儘快撥空登入 {sysURL}  填寫問卷，謝謝您！\r\r  您的登入信息如下：\r  帳號：{user_account} \r  密碼：{password}\r\r請注意：\r\r1、當您填寫問卷過程中需暫時離開系統時，請務必點選「保存」按鈕，以免數據遺失）\r2、如您要回家做問卷，請抄下網址、帳號及密碼，回家輸入網址後，登入帳號密碼即可填寫問卷。\r3、填寫完畢後，請務必按「交卷」按鈕，以確認問卷填寫完畢。\r\r 若您在填寫問卷過程當中有任何問題，請洽人事企劃課 分機135 蔡明璋。\r\r 謝謝您的參與！\r\r主管領導力提升專案工作小組 敬上', 'PUSH'),
(5, '感謝您熱情參與華歌爾360度管理職能評鑑活動', '人資管理部暨職能專案小組', '親愛的 {fullName} 您好：\r\r 參與才能夠了解，了解才會有共識， 有共識才會團結，團結就會力量大。\r\r 此次導入《職能》最終的目的，是希望建立《傳的典範》、《教的內容》、《帶的方法》，讓傳承發揮最大效能，藉以培養堅實幹部，企業得以永續經營。\r\r 因為各位的熱情參與和協助，即將完成第一階段專屬華歌爾的管理職能模組。這是大家共同的創作和時代任務，成就和意義非凡！後續將繼續建置《專業職能》，並據此成果，發展選、育、用、留之現代化人才育成計畫。\r\r 除了一份感動，特致上無荏謝忱！\r \r人資管理部暨職能專案小組敬上 104.09.18', 'THANKS');
